import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { showUser } from "../features/userDatailsSlice";
import { Link } from "react-router-dom";
import Create from "./Create";


function Read()
{
    const dispatch = useDispatch();

    const {users, loading} = useSelector((state)=>state.app)

    useEffect(()=>{
        dispatch(showUser());
    },[])

    return(         
       <div className='conatiner'>
            <Link to = "/Create" className='link'>Create +</Link>
            <table>
                <thead>
                    <tr>
                        <th>id</th>
                        <th>name</th>
                        <th>email</th>
                        <th>password</th>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody>
                    {users && users.map((d, i) => (
                        <tr>
                            <td>{d.id}</td>
                            <td>{d.name}</td>
                            <td>{d.email}</td>
                            <td>{d.password}</td>
                            <td>
                                <div className='btn'>
                                  <button>edit</button>
                                  <button>del</button>
                                </div>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
       </div>
    )
}
export default Read;
